function out = t_spd2sth(spec,lmbd,illuminant,system,out_space)
% % function out = t_spd2sth(spec,lmbd,illuminant,system,out_space)
% % --------------------------------------------------------------
% % 27.Mar.2017 (c) Arash Mirhashemi
% % Spectral data to Trichromatic values (XYZ-RGB-Lab)
% % --------------------------------------------------------------
% % Inputs:
% % spec       3D spectral image (spectrum in 3rd dimension) or 2D matrix of spectral vectors (spectra in columns)
% % lmbd       range of wavelengths of the spectral data as a vector or as [lmbd_start lmbd_interval lmbd_end] triplet
% % illuminant 'A-B-C-D65-sRGB-D50-F2-F8-F11-TLD-L1-L2-L3-EE(equal-energy)' --> CIE standard illuminations
% %            or arbitrary light source [lmbd, spectrum]--> 1st col or row wavelenghts and 2nd the lightsource
% % system     [default = 1931] or 1964 ---> the colormatching functions
% % out_space  'XYZ' 'RGB' 'Gray' 'Lab' ---> the output trichromatic systems
% % 
% % Outputs:
% % out        the thrichromatic output matrix or image
% % --------------------------------------------------------------
% % NOTE: Floating point spectral data are assumed to be in range [0,1]. No checking is applied by the function.
% %       For unsigned-integer values the range is assumed to be [0,intmax(class(spec))], such data are converted to 
% %       double by devision to intmax(class(spec)) before further calculations.
% % Note: Only the input (spec) and (lmbd) in the visible range 360::830 is used in calculating trichromatic values. 
% %       Other wavelengths are discarded.
% % Note: The CIE standard illuminants and the xyz color matching function data are provided at the end of the file.
% % --------------------------------------------------------------

if isnumeric(illuminant)
    if size(illuminant,1)<size(illuminant,2); illuminant = illuminant'; end
    lcol = 2;
    illuminants = illuminant;
else
    illuminant = upper(illuminant);
    switch upper(illuminant)
        case 'A'    , lcol = 2;
        case 'B'    , lcol = 3;
        case 'C'    , lcol = 4;
        case 'D65'  , lcol = 5;
        case 'SRGB' , lcol = 5;
        case 'D50'  , lcol = 6;
        case 'F2'   , lcol = 7;
        case 'F8'   , lcol = 8;
        case 'F11'  , lcol = 9;
        case 'TLD'  , lcol = 13;
        case 'L1'   , lcol = 10;
        case 'L2'   , lcol = 11;
        case 'L3'   , lcol = 12;
        case 'EE'   , lcol = 14;
        otherwise
            display('Unkonwn illumination option! Default D65');
            lcol = 5;
    end
    illuminants = f_illumination();
end

if (system == 1964)
    st = f_xyz_1964();
elseif (system == 1931)
    st = f_xyz_1931();
else
    display('Unkonwn system choice! Default used 1931!')
    st = xyz1931_360_1_830;
end;

if length(lmbd)>3
    wave = lmbd(:); % Turns into a vector
else 
    wave = (lmbd(1):lmbd(2):lmbd(3))';
end
ignore = [find(wave < 360), find(wave > 830)];
wave(ignore) = []; % that's the st(xyz) limit of data samples that we have
sizlmd = length(wave);

xyz = [ interp1(st(:,1), st(:,2), wave),...
    interp1(st(:,1), st(:,3), wave),...
    interp1(st(:,1), st(:,4), wave)];
light = interp1(illuminants(:,1), illuminants(:,lcol), wave);

% % k is set so that: Y(of XYZ) = 100*sum(Light * y(of xyz) * q)/(sum(Light * y(of xyz)) ---> so if q=all-1s then Y=100
k = 100/(xyz(:,2)' * light);
convXYZ = k.*repmat(light',[3,1]).*xyz';

% % --------------------------------------------
if isinteger(spec)
    spec = doublt(spec)./double(intmax(class(spec)));
end
sizlen = size(spec);
sizdim = length(sizlen);
if (sizdim > 2) % Image Cube
    spec = reshape(permute(spec,[3,1,2]),sizlen(3),[]);
end
spec(ignore,:) = [];
% % --------------------------------------------

XYZ = convXYZ*spec;

if strcmpi(out_space,'XYZ')
    out = XYZ;

elseif strcmpi(out_space,'RGB')||strcmpi(out_space,'Gray')
    convRGB = [ 3.2410,   -1.5374,   -0.4986;
               -0.9692,    1.8760,    0.0416;
                0.0556,   -0.2040,    1.0570];
    RGB = convRGB*XYZ;
    RGB = RGB/100;
    RGB = min(1, RGB);
    RGB = max(0, RGB);
    % applying gamma correction
    tmp1 = RGB <= 0.00304;
    tmp2 = RGB > 0.00304;
    RGB(tmp1) = 12.92*RGB(tmp1);
    RGB(tmp2) = 1.055*(RGB(tmp2).^(1/2.4))-0.055;
    if strcmpi(out_space,'RGB')
        out = RGB;
    elseif strcmpi(out_space,'Gray')
        out = 30/100*RGB(1,:)+59/100*RGB(2,:)+11/100*RGB(3,:);
    end
    
elseif strcmpi(out_space,'Lab')
    if min(wave) < 420 && max(wave) > 680
        % Calculate exact values for reference white
        XYZ0 = convXYZ * ones(sizlmd,1); XYZ0(2) = 100;
    else  % Use precalculated values, if spectra too narrow
        if system == 1931 % (calc. from 380:10:780)
            if     lcol == 2;  XYZ0 = [109.83;  100;   35.55]; % 'A'
            elseif lcol == 3;  XYZ0 = [ 99.07;  100;   85.22]; % 'B'
            elseif lcol == 4;  XYZ0 = [ 98.04;  100;  118.10]; % 'C'
            elseif lcol == 5;  XYZ0 = [ 95.02;  100;  108.81]; % 'D65' 
            else display('LAB default white reference (D65) used');
                XYZ0 =  [95.02;  100;  108.81];
            end;
        elseif system == 1964 % (calc. from 380:5:780) --> max rang is (360:1:830) for which the values are slightly different as below
            if     lcol == 2;  XYZ0 = [111.15;  100;   35.20]; % 'A' (360:1:830)-->[111.14 ...]
            elseif lcol == 3;  XYZ0 = [ 99.19;  100;   84.36]; % 'B' (360:1:830)-->[...  84.33] 
            elseif lcol == 4;  XYZ0 = [ 97.28;  100;  116.14]; % 'C'
            elseif lcol == 5;  XYZ0 = [ 94.81;  100;  107.33]; % 'D65'
            else display('LAB default white reference (D65) used');
                XYZ0 = [94.81;  100; 107.33];
            end;
        else error('Unknown System selected!');
        end;
    end;
    %--------------------------
    FXYZ = bsxfun(@rdivide,XYZ,XYZ0);
    I = FXYZ(2,:) > 0.008856;
    Lt(I) = 116 * FXYZ(2,I).^(1/3) - 16;
    YY(I) = FXYZ(2,I).^(1/3);
    Lt(~I) = 903.292 * FXYZ(2,~I);
    YY(~I) = 7.787 * FXYZ(2,~I) + 16/116;
    I = FXYZ(1,:) > 0.008856;
    XX(I) = FXYZ(1,I).^(1/3);
    XX(~I) = 7.787 * FXYZ(1,~I) + 16/116;
    I = FXYZ(3,:) > 0.008856;
    ZZ(I) = FXYZ(3,I).^(1/3);
    ZZ(~I) = 7.787 * FXYZ(3,~I) + 16/116;
    at = 500 * (XX - YY);
    bt = 200 * (YY - ZZ);
    out = [Lt; at; bt];
end
% % --------------------------------------------
if (sizdim > 2) % Image Cube
    out = reshape(permute(out,[2,3,1]),sizlen(1),sizlen(2),[]);
end

end
% % -------------------------------------------------------------

